import React from "react";
import './index.css';

const Card_two = () => (
  <div className="card-2">
    <div className="background-2">
      {/* Background image */}
      <img src="ComponentTMP_0-image.jpg" alt="Background Image" className="background-image-2" />
    </div>
    <div className="content-2">
      <h2 className="title-2">Nombres</h2>
      <p className="text-2">Bon retour sur votre interface administrateur</p>
    </div>
  </div>
);

export default Card_two;
